    <script type="text/javascript">
        var Collection = {

            Node: function(value) {
                this.value = value;
                this.previous = null;
                this.next = null;
            },

            List: function() {
                this.length = 0;
                this.head = null;
                this.tail = null;
            }
        }


        Collection.List.prototype.addItem = function(item) {

            var node = new Collection.Node(item);

            if (this.length === 0) {
                this.head = node;
                this.tail = node;
            } else {
                this.tail.next = node;
                node.previous = this.tail;
                this.tail = node;
            }

            this.length++;
            return node;
        };

        Collection.List.prototype.forEach = function(callback) {

            var currentNode = this.head,
                index = 0;

            while(currentNode){
                if(callback(currentNode.value, index))
                    return;
                currentNode = currentNode.next;
                index++;
            }
        };

        Collection.List.prototype.forEachNode = function(callback) {

            var currentNode = this.head,
                index = 0;

            while(currentNode){
                if(callback(currentNode, index))
                    return;
                currentNode = currentNode.next;
                index++;
            }
        };


        Collection.List.prototype.get = function(position) {

            if(!this.head)
                return null;

            if (position < 0 || position >= this.length) {
                throw new Error("Opa");
            }

            var val = null;

            this.forEach(function(value, index){
                if(position === index){
                    val = value;
                    return true;
                }
                return false;
            });

            return val;
        };

        Collection.List.prototype.getNode = function(position) {

            if(!this.head)
                return null;

            if (position < 0 || position >= this.length) {
                throw new Error("Opa");
            }

            var nod = null;

            this.forEachNode(function(node, index){
                if(position === index){
                    nod = node;
                    return true;
                }
                return false;
            });

            return nod;
        };

        Collection.List.prototype.indexOf = function(item) {

            var rIndex = -1;
            this.forEach(function(value, index){
                if(value === item){
                    rIndex = index;
                    return true;
                }
                return false;
            });

            return rIndex;
        };

        Collection.List.prototype.removeItem = function(item) {
            var indexToRemove = this.indexOf(item);
            if(indexToRemove >= 0)
                return this.remove(indexToRemove);
        };

        Collection.List.prototype.remove = function(position) {

            if(!this.head)
                return false;

            if (position < 0 || position >= this.length) {
                throw new Error("Opa");
            }

            var node = this.getNode(position);

            if(node.previous && node.next){

                var p = node.previous;
                var n = node.next;
                p.next = n;
                n.previous = p;

                node.next = null;
                node.previous = null;
                node = null;

                this.length--;

                return true;
            }
            else if(node.next){

                var n = node.next;
                this.head = n;
                this.head.prevous = null;

                node.next = null;
                node = null;

                this.length--;

                return true;
            }
            else if(node.previous){

                var p = node.previous;

                p.next = null;
                this.tail = p;

                node.previous = null;
                node = null;

                this.length--;

                return true;
            }
            else{

                this.head = null;
                this.tail = null;

                this.length--;

                return true;
            }

            return false;
        };
    </script>

                var aspect = dimensions.size().x / dimensions.size().y;

                } else if (event.originalEvent.touches.length == 3) {
                    MouseActions.target.find("canvas").on('touchmove', MouseActions.onDocumentThreeTouchMove);
                    MouseActions.target.find("canvas").on('touchend', MouseActions.onDocumentMouseUp);
                    MouseActions.target.find("canvas").on('touchcancel', MouseActions.onDocumentMouseOut);

                var touch = event.originalEvent.touches[0] || event.originalEvent.changedTouches[0];

            onDocumentMouseUp: function (event) {
                MouseActions.unregisterListeners();

            onDocumentMouseOut: function (event) {

                MouseActions.mousePrevX = x;

            manageRotation: function(x, y){
                var deltaRotationX = x - MouseActions.mousePrevX;
                var deltaRotationY = y - MouseActions.mousePrevY;

                MouseActions.mousePrevY = y;
                if(MouseActions.mouseActionListener)

            manageTransition: function(x, y){

                MouseActions.mousePrevY = y;
                if(MouseActions.mouseActionListener)

            }

        };

        ThreeData.ThreeDataBase.prototype.toRadians = function(angle) {
            return angle * (Math.PI / 180);
        };
        ThreeData.ThreeDataBase.prototype.pendingTransformations = function () {

            if(this.isStatic)
                return;

            if(!this.initialTransformations){
                this.center(true);
                this.initialTransformations = true;
            }
        };

        ThreeData.ThreeDataBase.prototype.rotate = function (x, y) {

            if(this.isStatic)
                return;

            var rotationMatrixY = new THREE.Matrix4();
            var db = this.threeObj.worldToLocal(new THREE.Vector3(0, 0, 0));
            var v1 = this.threeObj.worldToLocal(new THREE.Vector3(0, 1, 0));
            v1.sub(db);
            rotationMatrixY.makeRotationAxis(v1.normalize(), this.toRadians(x));

            v1 = this.threeObj.worldToLocal(new THREE.Vector3(1, 0, 0));
            v1.sub(db);
            var rotationMatrixX = new THREE.Matrix4();
            rotationMatrixX.makeRotationAxis(v1.normalize(), this.toRadians(y));

            rotationMatrixX.multiply(rotationMatrixY);

            this.threeObj.matrix.multiply(rotationMatrixX);

        };

        ThreeData.ThreeDataBase.prototype.transition = function (x, y) {

            if(this.isStatic)
                return;

            var translation = new THREE.Matrix4();
            translation.makeTranslation(x, -y, 0);

            this.threeObj.matrix.premultiply(translation);
        };

        /** BASE END **/

        /** DAE BEGIN **/

        ThreeData.Dae.prototype = Object.create(ThreeData.ThreeDataBase.prototype);
        ThreeData.Dae.prototype.constructor = ThreeData.Dae;

        ThreeData.Dae.prototype.generateInner = function () {
            var owner = this;
            var dae = owner.collada.scene;

            owner.animations = owner.collada.animations;
            owner.kfAnimationsLength = owner.animations.length;
            owner.kfAnimations = null;

            var parent = new THREE.Object3D();
            parent.add(dae);

            owner.initAnimations();
            owner.generationDone(parent);
        };

        ThreeData.Dae.prototype.center = function (onlyCenter3DObject) {

            if(this.isStatic)
                return;

            var originalDae = this.threeObj.children[0];
            this.threeObj.matrixAutoUpdate = false;
            originalDae.matrixAutoUpdate = false;

            var worldMiddleDae = new THREE.Vector3();
            var dimensions = new THREE.Box3().setFromObject(originalDae);

            worldMiddleDae.addVectors(dimensions.min, dimensions.max);
            worldMiddleDae.divideScalar(2.0);
            worldMiddleDae = this.threeObj.worldToLocal(worldMiddleDae);

            var translationSub = new THREE.Matrix4();
            translationSub.makeTranslation(-worldMiddleDae.x, -worldMiddleDae.y, -worldMiddleDae.z);

            if (!onlyCenter3DObject) {//Center the rotation geometric center
                var translationAdd = new THREE.Matrix4();
                translationAdd.makeTranslation(worldMiddleDae.x, worldMiddleDae.y, worldMiddleDae.z);
                this.threeObj.matrix.multiply(translationAdd);
            }
            originalDae.matrix.multiply(translationSub);
        };

        ThreeData.Dae.prototype.centerPosition = function() {
            this.threeObj.matrix.setPosition(new THREE.Vector3( 0, 0, 0 ))
        }

        ThreeData.Dae.prototype.initAnimations = function() {
            if(this.animations.length>0)
                this.kfAnimations=Three.mixer.clipAction( this.animations[ 0 ] )            
        };

        ThreeData.Dae.prototype.animate = function(timestamp) {
            if(!timestamp)
                return;
            //var frameTime = (timestamp - this.lastTimestamp) * 0.001;
            var delta = Three.clock.getDelta();
            if(!this.kfAnimations.paused){
                if(!this.targetReached)
                    Three.mixer.update( delta );
                this.targetReached=  Three.mixer.timeScale==1 ? this.kfAnimations.time>=this.target :this.kfAnimations.time<=this.target;
                //so the mixer dosent have logick to crop exacltly the time at the end of the step so i do it for them
                if(this.targetReached){
                    this.kfAnimations.time=this.target;
                    Three.mixer.update( 0 );
                }
                this.progress = this.target;
                this.notifyTarget();
            }   
        };

        ThreeData.Dae.prototype.newFrameInner = function(timestamp) {
            if(this.kfAnimations)
                this.animate(timestamp);
        };

        ThreeData.Dae.prototype.notifyTarget = function() {
            if(this.targetReached){

                if (this.kfAnimations.loop!=THREE.LoopOnce && this.isPlayOrReverse) {
                    if(this.progress == this.animation.startTime)
                        this.target = this.animation.endTime;
                    else if(this.progress == this.animation.endTime)
                        this.target = this.animation.startTime;
                } else {
                    this.kfAnimations.paused = true;
                }

                if(this.progress == this.animation.startTime){

                    Three.mixer.timeScale=1;
                }
                else if(this.progress == this.animation.endTime){

                    Three.mixer.timeScale=-1;
                }
                this.stateCallback(this);
            }
        };

        ThreeData.Dae.prototype.init = function(animation, stateCallback) {

            if (!animation)
                return;

            this.stateCallback = stateCallback;
            this.animation = animation;
            this.target = this.animation.initialTime;
            this.progress = this.animation.initialTime;
            this.targetReached = true;
            this.isPlayOrReverse = false;

            var phases = [];
            var steps = [];
            var initStartTime = 0;
            if (this.animation.phases) {
                var delta = 0;
                var lastStep = 0;
                for (var phaseIdx = 0; phaseIdx < this.animation.phases.length; phaseIdx++) {
                    let phase = this.animation.phases[phaseIdx];
                    if (phase.steps) {
                        phase.steps.forEach(function (step) {
                            steps.push(step.endTime + delta);
                            lastStep = step.endTime;
                        });
                        phases.push({
                            "name": phase.name,
                            "endTime": phase.endTime
                        });
                    }
                    delta += lastStep;
                    if (phaseIdx == this.animation.initialPhaseIdx - 1) {
                        initStartTime = phases[this.animation.initialPhaseIdx - 1].endTime;
                    }
                }

            }
            this.steps = steps;
            this.phases = phases;
            if(this.kfAnimations)
            {
                this.kfAnimations.clampWhenFinished=true;
                this.kfAnimations.loop=THREE.LoopOnce;
                this.playToTime(initStartTime);
            }
            this.stateCallback(this);

        };

        ThreeData.Dae.prototype.play = function() {
            this.isPlayOrReverse = true;
            if(!this.kfAnimations)
                return;
            this.kfAnimations.play();
            this.targetReached = false;
            Three.mixer.timeScale=1;
            this.kfAnimations.paused = false;
            this.target = this.animation.endTime;
            this.stateCallback(this);
        };

        ThreeData.Dae.prototype.pausee = function() {
            this.kfAnimations.paused = true;
            this.stateCallback(this);
        };

        ThreeData.Dae.prototype.reverse = function(backwardTo) {
            this.isPlayOrReverse = true;
            if(!this.kfAnimations)
                return;
            this.targetReached = false;
            Three.mixer.timeScale=-1;
            this.kfAnimations.paused = false;
            this.target = this.animation.startTime;
            this.stateCallback(this);
        };

        ThreeData.Dae.prototype.setLoop = function() {
            if (this.kfAnimations &&this.kfAnimations.paused) {
                //var newIsLoopVal = !this.isLoop;
                if ( this.kfAnimations.loop==THREE.LoopOnce) {
                    $("#loop").addClass("loopOn");
                    $("#loop").prop('title', 'Stop loop');
                    this.kfAnimations.loop=THREE.LoopRepeat;
                } else {
                    $("#loop").removeClass("loopOn");
                    $("#loop").prop('title', 'Start loop');
                    this.kfAnimations.loop=THREE.LoopOnce;
                }
            }
        }

        ThreeData.Dae.prototype.next = function() {
            if(!this.kfAnimations)
                return;
            if(this.hasSteps()){
                this.kfAnimations.loop=THREE.LoopOnce;
                var owner = this;
                var targetStepTime = null;
                this.steps.forEach(function(step){
                    if(targetStepTime)
                        return;
                    if(owner.progress < step)
                        targetStepTime = step;
                });
                if(targetStepTime){
                    this.isPlayOrReverse = false;
                    this.target = targetStepTime;
                    this.targetReached = false;
                    Three.mixer.timeScale=1;
                    this.kfAnimations.paused = false;
                    this.kfAnimations.play();
                    this.stateCallback(this);
                }
            }
        };
        

        ThreeData.Dae.prototype.prev = function() {
            if(!this.kfAnimations)
                return;
            if(this.hasSteps()){
                this.kfAnimations.loop=THREE.LoopOnce;
                var owner = this;
                var targetStepTime = null;
                this.steps.forEach(function(step){
                    if(owner.progress > step)
                    targetStepTime = step;
                });
                if (targetStepTime == null && this.progress > this.animation.startTime) {
                    targetStepTime = this.animation.startTime;
                }
                if (targetStepTime != null) {
                    this.isPlayOrReverse = false;
                    this.target = targetStepTime;
                    this.targetReached = false;
                    Three.mixer.timeScale=-1;
                    this.kfAnimations.paused = false;
                    this.kfAnimations.play();
                    this.stateCallback(this);
                }
            }
        };

        ThreeData.Dae.prototype.playToTime = function (endTime) {
            Three.mixer.timeScale=1;
            this.kfAnimations.reset();
            this.kfAnimations.play();
            this.kfAnimations.paused=false;
            this.target=endTime;
            this.progress=endTime;
            Three.mixer.update( this.target);
            this.kfAnimations.paused=true;            
            this.targetReached=true;
            if(endTime==this.animation.endTime)
                Three.mixer.timeScale=-1;
        };
       
        ThreeData.Dae.prototype.nextPhase = function() {
            if(!this.kfAnimations)
                return;
                
            var owner = this;
            var nextPhaseTime = null;
            var phs = this.phases;
            this.steps.forEach(function(step){
                if(nextPhaseTime)
                    return;
                if(owner.progress < step) {
                    var sortedPhases = phs.sort(function(a,b) { return a.endTime - b.endTime;});
                    sortedPhases.forEach(function(phase){
                        if (phase.endTime >= step && nextPhaseTime == null) {
                            nextPhaseTime = phase.endTime;
                        }
                    });
                }
            });
            if(nextPhaseTime){

                this.playToTime(nextPhaseTime);
                this.stateCallback(this);
            }
        };

        ThreeData.Dae.prototype.prevPhase = function() {
            if(!this.kfAnimations)
                return;
            var prevPhaseTime = null;
            var phs = this.phases;
            var sortedPhases = this.phases.sort(function (a, b) { return b.endTime - a.endTime; });
            for (var phaseIdx = 0; phaseIdx < this.phases.length; ++phaseIdx) {
                let phase = this.phases[phaseIdx];
                if (phase.endTime < this.progress && prevPhaseTime == null) {
                    prevPhaseTime = phase.endTime;
                    break;
                }
            }
            if(prevPhaseTime!=null){
                this.playToTime(prevPhaseTime);
                this.stateCallback(this);
            }
            
            
        };

        ThreeData.Dae.prototype.hasSteps = function() {
            return this.steps.length > 0;
        };

        ThreeData.Dae.prototype.begin = function() {
            if(!this.kfAnimations)
                return;
           
            this.playToTime(this.animation.startTime);
            this.stateCallback(this);
        };
       
        ThreeData.Dae.prototype.end = function() {
            if(!this.kfAnimations)
                return;
            if (this.steps){
                this.playToTime(this.steps[this.steps.length-1]);
                this.stateCallback(this);                
            }
            
        };

        ThreeData.Dae.prototype.endToStepTime = function(stepTime) {
            if(!this.kfAnimations)
                return;
            this.playToTime(stepTime);
            this.stateCallback(this);      
        };

        ThreeData.Dae.prototype.staticRotateX = function (degrees) {
            var rotationMatrix = new THREE.Matrix4();
            rotationMatrix.makeRotationX(this.toRadians(degrees));
            this.threeObj.matrix = rotationMatrix;
        }

        ThreeData.Dae.prototype.staticRotateY = function (degrees) {
            var rotationMatrix = new THREE.Matrix4();
            rotationMatrix.makeRotationY(this.toRadians(degrees));
            this.threeObj.matrix = rotationMatrix;
        }
        
		ThreeData.Dae.prototype.initRotate = function () {
			if (ThreeData.rotationMatrix) {
				var translation = new THREE.Matrix4();
				var extractRotation = translation.extractRotation(ThreeData.rotationMatrix);
				var inverse = translation.getInverse(extractRotation, false);
				this.threeObj.matrix = inverse;				
			}
		};
		
		ThreeData.Dae.prototype.setRotationMatrix = function () {
			var fakeViewNode = this.threeObj.getObjectByName(ThreeData.viewPointNodeName);									
			if (fakeViewNode != null && fakeViewNode.matrix != null) {
				ThreeData.rotationMatrix = fakeViewNode.matrix;
			}
		};
    </script>
    <script type="text/javascript">
        var ThreeUtil = {

            dae: null,
            daeWire: null,
            dae_target: null,

            load: function () {
                Three.load($("#webGLContainer"));

                MouseActions.load(Three.webGLContainer, {

                    onMouseDown: function () {
                        ThreeUtil.dae.center();
                    },

                    onMouseMove: function (x, y, buttonID) {
                        if (buttonID == 0) {
                            ThreeUtil.dae.rotate(x / 3, y / 3);
                        } else if (buttonID == 1) {
                            ThreeUtil.dae.transition(x * 0.01, y * 0.01);
                        }
                    }
                });

                ThreeUtil.loadDae(document.getElementById("DAE").innerHTML, true);
                //ThreeUtil.loadDae("resources/TFN7E8C.dae", false);
                ThreeUtil.initButtons();				
                Three.zoomFit();
            },

            daeLoaded: function () {
                if (Three.hasInScene(ThreeUtil.dae)) {
                    Three.removeFromScene(ThreeUtil.dae);
                }
                else {
					ThreeUtil.dae.setRotationMatrix();
					ThreeUtil.dae.initRotate();
                    Three.useObjectLight(ThreeUtil.dae);					
                    Three.addToScene(ThreeUtil.dae);
                }
                console.log(Three.scene);

                //var animations = document.getElementById("Animations").innerHTML

                ThreeUtil.dae.init(Animations3D, function (caller) {
                    var aplay = $("#play");
                    var apause = $("#pause");
                    var areverse = $("#reverse");
                    aplay.hide();
                    apause.hide();
                    areverse.hide();
                    if(this.kfAnimations){
                        if (this.kfAnimations.paused) {
                        if (Three.mixer.timeScale>0) {
                            aplay.show();
                        } else {
                            areverse.show();
                        }
                        } else {
                            apause.show();
                        }

                    }
                    ThreeUtil.initAnimationButtonsPermissions(ThreeUtil.dae_target);
                    ThreeUtil.setSelectedPhase(ThreeUtil.dae);
                });
                //ThreeUtil.dae.end();why
                //ThreeUtil.dae.centerDae();
                ThreeUtil.dae.center(true);
                ThreeUtil.dae_target = ThreeUtil.dae.animation.endTime;
                ThreeUtil.initAnimationButtonsPermissions(ThreeUtil.dae_target);
                ThreeUtil.initSelectPhases();
            },

            loadDae: function(content, isParse) {
                if (!isParse) {
                    Three.loadDae(content, function (collada) {
                        Three.mixer = new THREE.AnimationMixer( collada.scene );
                        ThreeUtil.dae = new ThreeData.Dae(collada, false, Three);
                        ThreeUtil.daeLoaded();
                        //initSelectViews();
                    });
                } else {
                    Three.parseDae(content, function (collada) {
                        Three.mixer = new THREE.AnimationMixer( collada.scene );
                        ThreeUtil.dae = new ThreeData.Dae(collada, false, Three);
                        ThreeUtil.daeLoaded();
                        //initSelectViews();
                    });
                }
            },

            initButtons: function() {

                $('#fit').click(function (e) {
					ThreeUtil.dae.center();
                    Three.zoomFit();
                    ThreeUtil.dae.centerPosition();
                    Three.zoomFit();
                });

                $("#play").click(function () {
                    if (!$(this).attr("disabled")) {
                        ThreeUtil.dae.play();
                    }
                });

                $("#pause").click(function () {
                    if (!$(this).attr("disabled"))
                        ThreeUtil.dae.pausee();
                });

                $("#reverse").click(function () {
                    if (!$(this).attr("disabled")) {
                        ThreeUtil.dae.reverse();
                    }
                });

                $("#loop").click(function () {
                    if (!$(this).attr("disabled"))
                        ThreeUtil.dae.setLoop();
                });
				
				$("#restoreState").click(function () {
                    if (!$(this).attr("disabled"))
                        ThreeUtil.dae.initRotate();
						ThreeUtil.dae.end();
						ThreeUtil.dae.center();
						Three.zoomFit();
						ThreeUtil.dae.centerPosition();
						Three.zoomFit();
                });

                $("#next").click(function () {
                    if (!$(this).attr("disabled")) {
                        ThreeUtil.dae.next();
                    }
                });

                $("#prev").click(function () {
                    if (!$(this).attr("disabled")) {
                        ThreeUtil.dae.prev();
                    }
                });

                $("#nextPhase").click(function () {
                    if (!$(this).attr("disabled")) {
                        ThreeUtil.dae.nextPhase();
                    }
                });

                $("#prevPhase").click(function () {
                    if (!$(this).attr("disabled")) {
                        ThreeUtil.dae.prevPhase();
                    }
                });

                $("#begin").click(function () {
                    if (!$(this).attr("disabled")) {
                        ThreeUtil.dae.begin();
                    }
                });

                $("#end").click(function () {
                    if (!$(this).attr("disabled")) {
                        ThreeUtil.dae.end();
                    }
                });

                $("#frontView").click(function() {
                    ThreeUtil.dae.staticRotateY(0);
                });

                $("#rearView").click(function() {
                    ThreeUtil.dae.staticRotateY(180);
                });

                $("#leftView").click(function() {
                    ThreeUtil.dae.staticRotateY(90);
                });

                $("#rightView").click(function() {
                    ThreeUtil.dae.staticRotateY(-90);
                });

                $("#topView").click(function() {
                    ThreeUtil.dae.staticRotateX(90);
                });

                $("#bottomView").click(function() {
                    ThreeUtil.dae.staticRotateX(-90);
                });
				
				
            },

            initAnimationButtonsPermissions: function (daeTarget) {
                if (!this.dae.hasSteps()){
                    $(".imageBtn").not("#fit").each(function() {
                        $(this).attr("disabled", true);
                    });
                    $("#phases").attr("disabled", true);
                    return;
                }
                if (ThreeUtil.dae.kfAnimations &&  ThreeUtil.dae.kfAnimations.loop!=THREE.LoopOnce) {
                    $("#loop").addClass("loopOn");
                    $("#loop").prop('title', 'Stop loop');                    
                } else {
                    $("#loop").removeClass("loopOn");
                    $("#loop").prop('title', 'Start loop');                    
                }
                if (!ThreeUtil.dae.kfAnimations || ThreeUtil.dae.kfAnimations.loop!=THREE.LoopOnce && ThreeUtil.dae.isPlayOrReverse && !ThreeUtil.dae.kfAnimations.paused) {
                    $("#next").attr("disabled", true);
                    $("#prev").attr("disabled", true);
                    $("#begin").attr("disabled", true);
                    $("#end").attr("disabled", true);
                    $("#nextPhase").attr("disabled", true);
                    $("#prevPhase").attr("disabled", true);
                    $("#loop").attr("disabled", true);
                    return;
                }

                if (ThreeUtil.dae.progress == 0) {
                    $("#next").attr("disabled", false);
                    $("#prev").attr("disabled", true);
                    $("#begin").attr("disabled", true);
                    $("#end").attr("disabled", false);
                    $("#nextPhase").attr("disabled", false);
                    $("#prevPhase").attr("disabled", true);
                } else if (ThreeUtil.dae.progress == daeTarget) {
                    $("#next").attr("disabled", true);
                    $("#prev").attr("disabled", false);
                    $("#begin").attr("disabled", false);
                    $("#end").attr("disabled", true);
                    $("#nextPhase").attr("disabled", true);
                    $("#prevPhase").attr("disabled", false);
                } else {
                    $("#next").attr("disabled", false);
                    $("#prev").attr("disabled", false);
                    $("#begin").attr("disabled", false);
                    $("#end").attr("disabled", false);
                    $("#nextPhase").attr("disabled", false);
                    $("#prevPhase").attr("disabled", false);
					
                    $("#restoreState").attr("disabled", false);
                }

                $("#loop").attr("disabled", !ThreeUtil.dae.kfAnimations.paused);
            },

            initSelectPhases: function() {
                var phases = this.dae.phases;
				
				var firstPhase = this.dae.animation.preFirstPhaseName;
				var startTime = this.dae.animation.startTime;
				phases.unshift({name: firstPhase, endTime: startTime});
				
                $('#phases').find('option').remove();

                $.each(phases, function (index, value) {
                    $('#phases').append($('<option/>', {
                        value: value.name,
                        text : value.name
                    }));
                });

                $("#phases").on('change', function() {
                    var selectedVal = this.value;
                    if (this.value != -1) {
                        var endStep = phases.filter(function(val, index, array) {
                            return val.name === selectedVal;
                        });

                        ThreeUtil.dae.endToStepTime(endStep[0].endTime);
                    }
                });

                ThreeUtil.setSelectedPhase(ThreeUtil.dae);
            },

            setSelectedPhase: function(dae) {
                var selectPhase = "-1";
                if (dae.phases) {
                    dae.phases.forEach(function(phase){
                        if (phase.endTime == dae.target) {
                            selectPhase = phase.name;
                        }
                    });
                }
                $("#phases").val(selectPhase);
            }
        }

        window.addEventListener('resize', function() {
            Three.containerResized();
        });

        $(document).ready(function() {
            ThreeUtil.load();
        });
    </script>

<code sid="VERTEX_SH">
#define maxBeziers 16
#define NEEDSTANYEXCOORDS 1
#define NEEDSTOXVECTOR 1

// Operation types
#define OT_NONE 0.0
#define OT_ARC_DEFORM 1.0
#define OT_CURVED_CREASE_DEFORM 2.0


//struct Bezier
//{
//	vec2 points[4];
//	vec3 props; // min, max, dmgZone
//}; // smarter parameter encoding needed! NB!!!!

// INTERFACE

	//mutable uniforms (per node/side)
//uniform Bezier B[maxBeziers];




uniform vec2 BezierPoints[maxBeziers*4];
uniform vec3 BezierProps[maxBeziers];

uniform vec4 arcData;
uniform vec4 curvedData; // each component is angle for one of the four curvedBashDeformators
#if NEEDSTANYEXCOORDS
uniform mat4 vertexToDesignMatrix;	//describes the transformation from vertex to design coordinates (3D - including the thickness, but flat(unfolded) )
#endif
#if NEEDSTOXVECTOR
uniform mat4 designToVertexMatrix;	//describes the transformation from design to vertex coordinates (3D - including the thickness, but flat(unfolded) ). inverse ot designToVertexMatrix
#endif

uniform float opType; // Operation Type FLag
attribute vec4 info1, info2, info3, info4; // info = { fNorm.xy -&gt; normalized 2D vector, info.z - scalar (magnitude of effect) -&gt; (0;1], info.w: zero-based bezier index, -1 for none  }
attribute vec3 curvedInfo1, curvedInfo2, curvedInfo3, curvedInfo4; // curvedInfo = {curvedInfo.x = Offset from folding edge, curvedInfo.y = Displacement weight}
// curvedNormInfo = {curvedNormInfo.x = angle of the tangent of the crease curve, curvedNormInfo.y - lenght of the segment perpendicular to the fold line, curvedNormInfo.z = angle of rotation of the fold line}
attribute vec3 curvedNormInfo1, curvedNormInfo2, curvedNormInfo3, curvedNormInfo4; 

// ~~~~~~~~~ outputs of the shader: &apos;position&apos; is transformed position of the vertex (in the final 3D) and &apos;normalVector&apos; is the normal to it;
//&apos;matTexCoords&apos; and &apos;sheetTexCoords&apos; are the transformed texture coordinates of the vertex (we use 2-D textures)
varying vec4 frag_position;
varying vec3 normalVector;

varying vec3 unchanged_normal;
#if NEEDSTOXVECTOR
varying vec3 oxVector;
#endif
// ~~~~~~~~~dynamic matrix section generated by ShaderCodeUnformGen
varying vec2 sheetTexCoord;
uniform vec4 sheetTexMatrix[2];

// ~~~~~~~~~
//~~~~~~~~~ gl_Vertex substitution with position for WEBGL

//~~~~~~~~~~
//~~~~~~~~~ gl_Normal substitution with normal for WEBGL

//~~~~~~~~~~

//This method calculates the displacements to apply to a vertex and its normal implied by a certain deformator
//All the calculations are caried out in the original (that of the mesh) coord-system
//@vertInfo is one of the info entries - cpecifies index of deformator and how the vertex is to be affected by it.
//@posOffset is displacement to be applied to the vertex (according to this vertInfo)
//   at the end the middle of all the offsets applied from all the deformators is applied
//@posOffset.w is the weight of this deformator for this vertex.
//@modifiedNorm is the normal calculated by this deformator
//@texOrigin is the &apos;vertex coordinates&apos; for which texture coordinates must be calculated. its a modification of the original gl_Veretx
bool transform(vec4 vertInfo, out vec4 posOffset, out vec3 modifiedNorm, out vec4 Tex) // p = [0..3]; Vert = deviation iff &apos;true&apos; is returned
{
	posOffset = vec4(0.0);
	Tex = vec4(0.0);
	modifiedNorm = normal;

	if (vertInfo.w &lt; 0.0)
		return false;	
	int idxB = int(vertInfo.w);             //idex in &apos;B&apos; to use. -1 stands for &apos;none&apos;

	vec2 curCurvPoint0= BezierPoints[idxB*4];
	vec2 curCurvPoint1= BezierPoints[idxB*4+1];
	vec2 curCurvPoint2= BezierPoints[idxB*4+2];
	vec2 curCurvPoint3= BezierPoints[idxB*4+3];
	vec3 curCurvProps= BezierProps[idxB];

		
	float flVertexScalar = vertInfo.z;		//value between 0 and 1 describing the &apos;relevance&apos; of the vertex from the deformator
	if (flVertexScalar &lt;= curCurvProps.x || flVertexScalar &gt; curCurvProps.y) // bounds checking
		return false;
	
		//t aligned in the interval (0, 1], ready to be used as an argument of the bezier
	float t = (flVertexScalar - curCurvProps.x) / (curCurvProps.y - curCurvProps.x); // pure linear remap
		//the bezier curve is defined as
		//cp[0]*(1-t)^3 + 3*cp[1]*t*(1-t)^2 + 3*cp[2]*t^2*(1-t)+3*cp[3]*t^3
		//V is the basis polynomes (1-t)^3 ...)

		//T = V&apos;s derivative
	vec4 T = vec4(-3.0*(1.0-t)*(1.0-t), 9.0*t*t-12.0*t+3.0, 6.0*t-9.0*t*t, 3.0*t*t);
	vec4 V = vec4(	pow(1.0 - t, 3.0),
					-T.x*t,					//3.0 * t * (1.0 - t)   * (1.0 - t), // do NOT ever, ever forget the coefficients
					T.w*(1.0-t),			//3.0 * t * t			* (1.0 - t),
					pow(t, 3.0)
				);
		//M is the array of 4 control points
	vec4 Mx = vec4(curCurvPoint0.x, curCurvPoint1.x, curCurvPoint2.x, curCurvPoint3.x);
	vec4 My = vec4(curCurvPoint0.y, curCurvPoint1.y, curCurvPoint2.y, curCurvPoint3.y);
//	mat4x2 M = mat4x2(curCurvPoint0, curCurvPoint1, curCurvPoint2, curCurvPoint3);
		//posOnBezier is the position of the point with parameter &apos;t&apos; on the bezier curve
		//M*V = cp[0]*(1-t)^3 + 3*cp[1]*t*(1-t)^2 + 3*cp[2]*t^2*(1-t)+3*cp[3]*t^3
//	vec2 posOnBezier = (M*V).xy;
	vec2 posOnBezier = vec2(dot(Mx, V), dot(My, V));
		//the position of the point in the damage zone coordinate system
	vec2 posOriginInZone = (flVertexScalar - curCurvProps.x) * curCurvProps.z * vertInfo.xy;	
		//posOffset = the offset of the point from its original position.
	posOffset.xyz = /* bezier */vec3(posOnBezier.x * vertInfo.xy - posOriginInZone, 0.0)  + posOnBezier.y * normal; 			//the positino of the point after transformed by the bezier.
	
	// tex gen
	//vec2 P,Q;
	//P = gl_Vertex.xy - (flVertexScalar - curCurvProps.x) * curCurvProps.z * vertInfo.xy;
	//Q = gl_Vertex.xy + (curCurvProps.y - flVertexScalar) * curCurvProps.z * vertInfo.xy;
	//Tex = (1.0-t)*P + t*Q;
		//Staso: tova ne go shvastam mnogo, ama e rezultata ot prostjavaneto na gornamta smetka
	//Tex = gl_Vertex + vec4((t*(curCurvProps.y - curCurvProps.x) * curCurvProps.z) * vertInfo.xy, 0., 0.);
	float corr = ((posOnBezier.x/curCurvPoint3.x) - flVertexScalar);
	Tex = vec4(position, 1.) + vec4(vertInfo.xy*(corr*curCurvProps.z), 0.0, 0.0);
	//(x-c.x)/(o.x-c.x)
	
	
		//N is 2-dimensional tangent to the curve described by th bezier.
	vec2 N = vec2(dot(Mx, T), dot(My, T));
//	vec2 N = normalize((M*T).xy);
		//(-N.y, N.x) is normal to the 2 dimensional bezier curve
	modifiedNorm = normalize(-N.y * vec3(vertInfo.xy, 0.0)+N.x * normal);
	
	posOffset.w = t;
	return true;
}

void transformArc()
{
	//arcData.xy - normal
	//arcData.z - distance
	//arcData.w - curvature = 1.0/radius

	float arcLength = dot((vec4(position, 1.)).xy, arcData.xy) - arcData.z;
	float alpha = arcLength * arcData.w;
	float a_sin = sin(alpha);
	float a_cos = cos(alpha);
	float negcos = 1.0-a_cos;
	//	arcData.xy, origOy, (0,0,1) form a right-orientate orgogonal coordinate system
	//which is stransfomed into
	// faceArcXY, origOy, faceNorm, 
	//1: vec3(arcData.xy,0)									--------&gt;   1&apos;: faceArcXY = cos*arcData.xy + sin*vec3(0,0,1)
	//2: vec3(-arcData.y,arcData.x,0.0)		  --------&gt;   2&apos;: origOy = vec3(-arcData.y, arcData.x, 0)
	//3: vec3(0,0,1)												--------&gt;   3&apos;: faceNorm = vec3(-a_sin*arcData.xy, a_cos)
	mat3 bendMatr;
	{
//		the code bellow is not exactly bug-free.... and producess too much code - some old NVIDIA cards can not handle it	
//		mat3 baseCS = mat3( arcData.x,   arcData.y, 0., 
//											 -arcData.y,   arcData.x, 0., 
//															 0.,          0., 1.);
//		mat3 transformedCS = mat3( a_cos*arcData.x, a_cos*arcData.y, a_sin,
//																		-arcData.y,       arcData.x,    0.,
//															-a_sin*arcData.x,-a_sin*arcData.y, a_cos);
//		transformedCS = transpose(transformedCS);
//		bendMatr = transformedCS*baseCS;
//		the solution which follows is from the math.dll (simplyfified based on the fact that rotaxis.dz==0.
//see Rotation3D::SetCS(const Vector3D&amp; v, double cosa, double sina) for &apos;how come&apos; the rest is just simplifactions

		vec2 negcos_xy2 = arcData.xy*arcData.xy*negcos;  // (x*x*(1-cos), y*y*(1-cos))
		vec2 xy_sin = arcData.xy*a_sin;                   // (x*sin, y*sin)
		float negcos_x_y = negcos*arcData.x*arcData.y;   // x*y*(1-cos)
		
		bendMatr = mat3(a_cos + negcos_xy2.y, -negcos_x_y          , xy_sin.x,
		                -negcos_x_y          , a_cos + negcos_xy2.x, xy_sin.y,
		                -xy_sin.x            , -xy_sin.y            , a_cos);
	}
           
	//bendMatr contains only the rotation component of the matrix, without any translation                            
	//(gl_Vertex.x, gl_Vertex.y, 0) is the &apos;base&apos; initial point
	//and basePos will is the required final position of the &apos;base&apos; point
	vec3 basePos;
	if ((alpha &lt; -0.03) || (alpha &gt; 0.03))
		basePos = vec3((vec4(position, 1.)).xy - arcData.xy*(arcLength-a_sin/arcData.w), negcos/arcData.w);
	else
		basePos = vec3((vec4(position, 1.)).xy, arcLength*arcLength*arcData.w/2.0);

	//vPosOffset is the offset vector from base initial position to the position produced by creases
	//if there are no creases, it would be (0,0,position.z)
	vec3 vPosOffset = vec3(frag_position.xy-(vec4(position, 1.)).xy, frag_position.z);
	frag_position.xyz = basePos+(bendMatr*vPosOffset);
	
	normalVector = bendMatr*normalVector;
#if NEEDSTOXVECTOR
	oxVector = bendMatr*oxVector;
#endif
}

#define PI 			3.14159265358979323846
#define PI_2 		1.57079632679489661923

vec3 calcNormal(float displacement, vec3 info, vec3 normInfo)
{
	float alpha = normInfo.x; // Angle of the tanget to the curve
	float weight = info.y;
	float lenght = sqrt(normInfo.y); // Length of the segment perpendicular to the fold line
	float sgn = sign(normalVector.z);

	vec3 tangent = vec3(0.0, cos(alpha), sin(alpha)); 			// tangent vector from the curvature of the crease
	vec3 bitangent = vec3(1.0, 0.0, 0.0);						// bitangent pointing perpendicular to the crease, used to taper down in case of opposite crease
	if (lenght != 0.0)
		bitangent = normalize(vec3(lenght, 0.0, displacement * sgn));

	float gamma = -normInfo.z; 									// &quot;-&quot; Because we want to rotate clockwise
	mat3 rotation = mat3(					// Rotate arround Z axis
		cos(gamma)	, -sin(gamma)	, 0.0,
		sin(gamma)	,  cos(gamma)	, 0.0,
		0.0			, 0.0			, 1.0
	);

	return sgn * rotation * cross(bitangent , tangent); 				// Should be normalized
}

vec3 calcDisplacement(vec3 info, float angle, float oyAngle)
{
	float offset = info.x;
	float weight = info.y;
	float alpha = angle / 2.0 * float(abs(angle - PI) &gt; 1.0E-8); // the second term prevents numerical instabilities near pi/2
	float tan_alpha = tan(alpha);
	float displacement = offset * tan_alpha;

	mat3 rotation = mat3(										// Rotate arround Z axis
		cos(oyAngle)	, -sin(oyAngle)	, 0.0,
		sin(oyAngle)	,  cos(oyAngle)	, 0.0,
		0.0			, 0.0				, 1.0
	);

	vec3 squeeze = vec3(0.0, 0.0 * info.z * tan_alpha, 0.0);

	return vec3(0.0, 0.0, displacement) + rotation * squeeze;
}

//const float inf = 1. / 0.;
const float inf = 3.402823466e+38;

void transformCurved()
{
	vec3 curveInfo[4];
	curveInfo[0] = curvedInfo1;
	curveInfo[1] = curvedInfo2;
	curveInfo[2] = curvedInfo3;
	curveInfo[3] = curvedInfo4;

	vec3 curveNormInfo[4];
	curveNormInfo[0] = curvedNormInfo1;
	curveNormInfo[1] = curvedNormInfo2;
	curveNormInfo[2] = curvedNormInfo3;
	curveNormInfo[3] = curvedNormInfo4;

	vec3 outDisplacement = vec3(0.0);
	vec3 mx = vec3(-inf), mn = vec3(inf);
	vec3 outNormVector = normalVector;
	float cnt = 0.0;
	for (int i = 0; i &lt; 4; i++)
	{
		vec3 displacement = calcDisplacement(curveInfo[i], curvedData[i], curveNormInfo[i].z);
		vec3 normal = calcNormal(curveInfo[i].y * displacement.z, curveInfo[i], curveNormInfo[i]);
		float weight = curveInfo[i].y * sin(curvedData[i]);

		mx = max(mx, displacement);
		mn = min(mn, displacement);

		outDisplacement += curveInfo[i].y * displacement;
		if (weight != 0.0)
			outNormVector += mix(outNormVector, normal, weight);
	}

	outDisplacement = clamp(outDisplacement, mn, mx);
	frag_position.xyz += outDisplacement;
	normalVector = normalize(outNormVector);
}

void main()
{
#if NEEDSTANYEXCOORDS
	vec4 tPos;
#endif
	
		//accumulators used to calculate the avarage of 
	vec4 sumVertOffset = vec4(0.0), curVertOffset;
	vec3 sumNorm = vec3(0.0), curNorm;
		//texture avaraging data
	vec4 sumTex = vec4(0.0), curTex;


{
	if (transform(info1, /*out*/curVertOffset, /*out*/curNorm, /*out*/curTex))
	{
		sumVertOffset.xyz += curVertOffset.w*curVertOffset.xyz;
		sumNorm += curNorm;
		sumTex += curVertOffset.w*curTex;
		sumVertOffset.w += curVertOffset.w;
	}
	if (transform(info2, /*out*/curVertOffset, /*out*/curNorm, /*out*/curTex))
	{
		sumVertOffset.xyz += curVertOffset.w*curVertOffset.xyz;
		sumNorm += curNorm;
		sumTex += curVertOffset.w*curTex;
		sumVertOffset.w += curVertOffset.w;
	}
	if (transform(info3, /*out*/curVertOffset, /*out*/curNorm, /*out*/curTex))
	{
		sumVertOffset.xyz += curVertOffset.w*curVertOffset.xyz;
		sumNorm += curNorm;
		sumTex += curVertOffset.w*curTex;
		sumVertOffset.w += curVertOffset.w;
	}
	if (transform(info4, /*out*/curVertOffset, /*out*/curNorm, /*out*/curTex))
	{
		sumVertOffset.xyz += curVertOffset.w*curVertOffset.xyz;
		sumNorm += curNorm;
		sumTex += curVertOffset.w*curTex;
		sumVertOffset.w += curVertOffset.w;
	}
}
		//oxVector before being deformed by the creases
#if NEEDSTOXVECTOR
//	oxVector = (designToVertexMatrix*vec4((normal).z, 0., 0., 0.)).xyz;
	oxVector = designToVertexMatrix[0].xyz * (normal).z;
#endif
		//the block bellow will calculate the outputs (position, normalVector, oxVector) in the panel&apos;s coordinate system
	if (sumVertOffset.w == 0.0)
	{		//flat surface: screw the data above.
		normalVector = normal;
			//this implements rotation of the Ox of the design to the coordinate system of the panel, 
			//and than to the scene coordinate system 
			//(having the w null suppresses the translation component of )designToVertexMatrix
		frag_position      = vec4(position, 1.);
    
#if NEEDSTANYEXCOORDS
		tPos = vertexToDesignMatrix * vec4(position, 1.);
		//tPos = vec4(dot(vertexToDesignMatrix[0], gl_Vertex), dot(vertexToDesignMatrix[1], gl_Vertex), 0.0, 1.0);
#endif
	}
	else
	{
			//the updated position (after applying modifiers)
		frag_position      = vec4(position, 1.) +vec4(sumVertOffset.xyz/sumVertOffset.w, 0.);
    
#if NEEDSTANYEXCOORDS
		{
			//vec4 newpos = sumTex/sumVertOffset.w;
			//tPos = vec4(dot(vertexToDesignMatrix[0], newpos), dot(vertexToDesignMatrix[1], newpos), 0.0, 1.0);
			tPos = vertexToDesignMatrix * (sumTex/sumVertOffset.w);
		}
#endif
		
		normalVector  = normalize(sumNorm);
#if NEEDSTOXVECTOR
		vec3 rotaxis = cross(normal, normalVector);
		if (length(rotaxis)&gt;=0.001)
		{
			rotaxis = normalize(rotaxis);
			vec3 vNormOrto = cross(rotaxis, normal);			//(vNormOrto, rotaxis, gl_Normal) form a coordinate system in the space before deformation
			vec3 vNormOrtoImage = cross(rotaxis, normalVector);	//(vNormOrtoImage, rotaxis, normalVector) form a coordinate system in the space after deformation
			vec3 oxCoords = vec3(dot(oxVector, vNormOrto), dot(oxVector, rotaxis), dot(oxVector, normal));		//coordinates of oxCoords in the non-transformed coordinage system
			oxVector = vNormOrtoImage*oxCoords.x + rotaxis*oxCoords.y + normal * oxCoords.z;	//oxVector after being bumped
		}
#endif
	}

	// if (arcData.w!=0.0)
	if (opType == OT_ARC_DEFORM)
		transformArc();

	if (opType == OT_CURVED_CREASE_DEFORM)
		transformCurved();
	
mat4 ModelViewProjectionMatrix=projectionMatrix * modelViewMatrix;
mat3 NormalMatrix= normalMatrix;
mat4 ModelViewMatrix= modelViewMatrix;
	
	unchanged_normal = normalVector;
	gl_Position   = ModelViewProjectionMatrix * frag_position;
		//transform from panel to user space
	normalVector = NormalMatrix * normalVector;
#if NEEDSTOXVECTOR	
	oxVector     = NormalMatrix * oxVector;
#endif	
	frag_position     = ModelViewMatrix * frag_position;

		//calculate texture coordinates ShaderCodeCalculasGen
	sheetTexCoord = vec2(dot(sheetTexMatrix[0],tPos), dot(sheetTexMatrix[1],tPos));

}

<code sid="FRAGMENT_SH">
#define ambientIdx 0
#define diffuseIdx 1
#define specularIdx 2
#define emissiveIdx 3
#define envReflectivityIdx 4
#define shininessIdx 0
#define opacityIdx 1
#define envAttenuationIdx 2
#define bumpsIntensityIdx 3
#define nReflectedIdx 1
#define nReflectedIdx1 2
#define nLightInfoComps 3
varying vec4 frag_position;
varying vec3 normalVector;
varying vec3 oxVector;
varying vec2 sheetTexCoord;
uniform float fMasterOpacity;
uniform sampler2D EnvDiff0;
uniform sampler2D paperBump1;
uniform float environmentDiffLightCoef;
uniform vec3 ambientLightColor;
#if NUM_DIR_LIGHTS &gt; 0
struct DirectionalLight
{
	vec3 direction;
	vec3 color;
	int shadow;
	float shadowBias;
	float shadowRadius;
	vec2 shadowMapSize;
};
uniform DirectionalLight directionalLights[ NUM_DIR_LIGHTS ];
#endif

#if NUM_POINT_LIGHTS &gt; 0
struct PointLight {
	vec3 position;
	vec3 color;
	float distance;
	float decay;
	int shadow;
	float shadowBias;
	float shadowRadius;
	vec2 shadowMapSize;
};
uniform PointLight pointLights[ NUM_POINT_LIGHTS ];
#define POINT_LIGHTS_BASE NUM_DIR_LIGHTS
#endif

#define nLightSources (NUM_DIR_LIGHTS+NUM_POINT_LIGHTS)
uniform float BumpIntensity0;
uniform vec3 reflectiveColors1[5];
uniform vec4 colorsCharacteristics1;

void main()
{
	vec3 N = normalize(normalVector);
	vec3 V = normalize(-frag_position.xyz);
	vec3 Ox = normalize(oxVector);

#if nLightSources &gt; 0
	vec3 L[nLightSources*nLightInfoComps];
	vec3 lightColors[nLightSources];
#endif

#if NUM_DIR_LIGHTS &gt; 0
	for (int iDirLight = 0; iDirLight &lt; NUM_DIR_LIGHTS; ++iDirLight)
	{
		vec3 ldir = directionalLights[iDirLight].direction;
		L[iDirLight] = ldir;
		L[iDirLight + nReflectedIdx * nLightSources] = reflect(-ldir, N);
		lightColors[iDirLight] = directionalLights[iDirLight].color;
	}
#endif
#if NUM_POINT_LIGHTS &gt; 0
	for (int iDirLight = 0; iDirLight &lt; NUM_POINT_LIGHTS; ++iDirLight)
	{
		vec3 ldir = normalize(pointLights[iDirLight].position- frag_position.xyz);
		L[iDirLight+POINT_LIGHTS_BASE] = ldir;
		L[iDirLight+POINT_LIGHTS_BASE + nReflectedIdx * nLightSources] = reflect(-ldir, N);
		lightColors[iDirLight+POINT_LIGHTS_BASE] = pointLights[iDirLight].color;
	}
#endif

	vec4 EnvDiffTexel;
	{
		vec2 sphSpecTexCoords = vec2(atan(N.z, N.x)/3.14159/2.0, N.y/2.0-0.5);
		EnvDiffTexel = texture2D(EnvDiff0, sphSpecTexCoords);
	}
	vec4 texel1 = texture2D(paperBump1, sheetTexCoord);

	vec3 N1;
	{
		vec3 bumpv = texel1.rgb*2.0-256./255.;
		bumpv.xy *= BumpIntensity0;
		bumpv = normalize(bumpv);
		vec3 baseOy = cross(N, Ox);
		N1 = bumpv.z*N + bumpv.x*Ox-bumpv.y*baseOy;
	}
#if nLightSources &gt; 0
	for (int iDirLight = 0; iDirLight &lt; nLightSources; ++iDirLight)
		L[iDirLight + nReflectedIdx1 * nLightSources] = reflect(-L[iDirLight], N1);
#endif

	vec4 EnvDiffTexel1;
	{
		vec2 sphSpecTexCoords = vec2(atan(N1.z, N1.x)/3.14159/2.0, N1.y/2.0-0.5);
		EnvDiffTexel1 = texture2D(EnvDiff0, sphSpecTexCoords);

//This method calculates the displacements to apply to a vertex and its normal implied by a certain deformator
//All the calculations are caried out in the original (that of the mesh) coord-system
//@vertInfo is one of the info entries - cpecifies index of deformator and how the vertex is to be affected by it.
//@posOffset is displacement to be applied to the vertex (according to this vertInfo)

//@modifiedNorm is the normal calculated by this deformator
//@texOrigin is the &apos;vertex coordinates&apos; for which texture coordinates must be calculated. its a modification of the original gl_Veretx
bool transform(vec4 vertInfo, out vec4 posOffset, out vec3 modifiedNorm, out vec4 Tex) // p = [0..3]; Vert = deviation iff &apos;true&apos; is returned
{
	posOffset = vec4(0.0);
	Tex = vec4(0.0);
	modifiedNorm = normal;

	if (vertInfo.w &lt; 0.0)
		return false;	
	int idxB = int(vertInfo.w);             //idex in &apos;B&apos; to use. -1 stands for &apos;none&apos;

	vec2 curCurvPoint0= BezierPoints[idxB*4];
	vec2 curCurvPoint1= BezierPoints[idxB*4+1];
	vec2 curCurvPoint2= BezierPoints[idxB*4+2];
	vec2 curCurvPoint3= BezierPoints[idxB*4+3];

	float t = (flVertexScalar - curCurvProps.x) / (curCurvProps.y - curCurvProps.x); // pure linear remap

		//cp[0]*(1-t)^3 + 3*cp[1]*t*(1-t)^2 + 3*cp[2]*t^2*(1-t)+3*cp[3]*t^3

		//T = V&apos;s derivative
	vec4 T = vec4(-3.0*(1.0-t)*(1.0-t), 9.0*t*t-12.0*t+3.0, 6.0*t-9.0*t*t, 3.0*t*t);

					-T.x*t,					//3.0 * t * (1.0 - t)   * (1.0 - t), // do NOT ever, ever forget the coefficients

	vec2 posOnBezier = vec2(dot(Mx, V), dot(My, V));

	//Tex = (1.0-t)*P + t*Q;
		//Staso: tova ne go shvastam mnogo, ama e rezultata ot prostjavaneto na gornamta smetka
	//Tex = gl_Vertex + vec4((t*(curCurvProps.y - curCurvProps.x) * curCurvProps.z) * vertInfo.xy, 0., 0.);
	float corr = ((posOnBezier.x/curCurvPoint3.x) - flVertexScalar);
	Tex = vec4(position, 1.) + vec4(vertInfo.xy*(corr*curCurvProps.z), 0.0, 0.0);

	vec2 N = vec2(dot(Mx, T), dot(My, T));

	modifiedNorm = normalize(-N.y * vec3(vertInfo.xy, 0.0)+N.x * normal);

void transformArc()
{

	float arcLength = dot((vec4(position, 1.)).xy, arcData.xy) - arcData.z;

	//2: vec3(-arcData.y,arcData.x,0.0)		  --------&gt;   2&apos;: origOy = vec3(-arcData.y, arcData.x, 0)
	//3: vec3(0,0,1)												--------&gt;   3&apos;: faceNorm = vec3(-a_sin*arcData.xy, a_cos)
	mat3 bendMatr;

//		the code bellow is not exactly bug-free.... and producess too much code - some old NVIDIA cards can not handle it

		vec2 negcos_xy2 = arcData.xy*arcData.xy*negcos;  // (x*x*(1-cos), y*y*(1-cos))
		vec2 xy_sin = arcData.xy*a_sin;                   // (x*sin, y*sin)
		float negcos_x_y = negcos*arcData.x*arcData.y;   // x*y*(1-cos)
		
		bendMatr = mat3(a_cos + negcos_xy2.y, -negcos_x_y          , xy_sin.x,
		                -negcos_x_y          , a_cos + negcos_xy2.x, xy_sin.y,
		                -xy_sin.x            , -xy_sin.y            , a_cos);
	}

	vec3 basePos;

#define PI 			3.14159265358979323846
#define PI_2 		1.57079632679489661923

vec3 calcNormal(float displacement, vec3 info, vec3 normInfo)
{
	float alpha = normInfo.x; // Angle of the tanget to the curve
	float weight = info.y;
	float lenght = sqrt(normInfo.y); // Length of the segment perpendicular to the fold line
	float sgn = sign(normalVector.z);

	vec3 tangent = vec3(0.0, cos(alpha), sin(alpha)); 			// tangent vector from the curvature of the crease
	vec3 bitangent = vec3(1.0, 0.0, 0.0);						// bitangent pointing perpendicular to the crease, used to taper down in case of opposite crease
	if (lenght != 0.0)
		bitangent = normalize(vec3(lenght, 0.0, displacement * sgn));

	float gamma = -normInfo.z; 									// &quot;-&quot; Because we want to rotate clockwise
	mat3 rotation = mat3(					// Rotate arround Z axis
		cos(gamma)	, -sin(gamma)	, 0.0,
		sin(gamma)	,  cos(gamma)	, 0.0,
		0.0			, 0.0			, 1.0
	);

	return sgn * rotation * cross(bitangent , tangent); 				// Should be normalized
}

vec3 calcDisplacement(vec3 info, float angle, float oyAngle)
{
	float offset = info.x;
	float weight = info.y;
	float alpha = angle / 2.0 * float(abs(angle - PI) &gt; 1.0E-8); // the second term prevents numerical instabilities near pi/2
	float tan_alpha = tan(alpha);
	float displacement = offset * tan_alpha;

	mat3 rotation = mat3(										// Rotate arround Z axis
		cos(oyAngle)	, -sin(oyAngle)	, 0.0,
		sin(oyAngle)	,  cos(oyAngle)	, 0.0,
		0.0			, 0.0				, 1.0
	);

	vec3 squeeze = vec3(0.0, 0.0 * info.z * tan_alpha, 0.0);

	return vec3(0.0, 0.0, displacement) + rotation * squeeze;
}

//const float inf = 1. / 0.;
const float inf = 3.402823466e+38;

void transformCurved()
{
	vec3 curveInfo[4];
	curveInfo[0] = curvedInfo1;
	curveInfo[1] = curvedInfo2;
	curveInfo[2] = curvedInfo3;
	curveInfo[3] = curvedInfo4;

	vec3 curveNormInfo[4];
	curveNormInfo[0] = curvedNormInfo1;
	curveNormInfo[1] = curvedNormInfo2;
	curveNormInfo[2] = curvedNormInfo3;
	curveNormInfo[3] = curvedNormInfo4;

	vec3 outDisplacement = vec3(0.0);
	vec3 mx = vec3(-inf), mn = vec3(inf);
	vec3 outNormVector = normalVector;
	float cnt = 0.0;
	for (int i = 0; i &lt; 4; i++)
	{
		vec3 displacement = calcDisplacement(curveInfo[i], curvedData[i], curveNormInfo[i].z);
		vec3 normal = calcNormal(curveInfo[i].y * displacement.z, curveInfo[i], curveNormInfo[i]);
		float weight = curveInfo[i].y * sin(curvedData[i]);

		mx = max(mx, displacement);
		mn = min(mn, displacement);

		outDisplacement += curveInfo[i].y * displacement;
		if (weight != 0.0)
			outNormVector += mix(outNormVector, normal, weight);
	}

	outDisplacement = clamp(outDisplacement, mn, mx);
	frag_position.xyz += outDisplacement;
	normalVector = normalize(outNormVector);
}

		{

			vec3 vNormOrto = cross(rotaxis, normal);			//(vNormOrto, rotaxis, gl_Normal) form a coordinate system in the space before deformation
			vec3 vNormOrtoImage = cross(rotaxis, normalVector);	//(vNormOrtoImage, rotaxis, normalVector) form a coordinate system in the space after deformation
			vec3 oxCoords = vec3(dot(oxVector, vNormOrto), dot(oxVector, rotaxis), dot(oxVector, normal));		//coordinates of oxCoords in the non-transformed coordinage system
			oxVector = vNormOrtoImage*oxCoords.x + rotaxis*oxCoords.y + normal * oxCoords.z;	//oxVector after being bumped
		}
#endif
	}

	// if (arcData.w!=0.0)
	if (opType == OT_ARC_DEFORM)
		transformArc();

	if (opType == OT_CURVED_CREASE_DEFORM)
		transformCurved();
	
mat4 ModelViewProjectionMatrix=projectionMatrix * modelViewMatrix;
mat3 NormalMatrix= normalMatrix;
mat4 ModelViewMatrix= modelViewMatrix;
	
	unchanged_normal = normalVector;
	gl_Position   = ModelViewProjectionMatrix * frag_position;
		//transform from panel to user space
	normalVector = NormalMatrix * normalVector;
#if NEEDSTOXVECTOR	
	oxVector     = NormalMatrix * oxVector;
#endif	
	frag_position     = ModelViewMatrix * frag_position;

		//calculate texture coordinates ShaderCodeCalculasGen
	sheetTexCoord = vec2(dot(sheetTexMatrix[0],tPos), dot(sheetTexMatrix[1],tPos));

}

#define ambientIdx 0
#define diffuseIdx 1
#define specularIdx 2
#define emissiveIdx 3
#define envReflectivityIdx 4
#define shininessIdx 0
#define opacityIdx 1

};

	int shadow;
	float shadowBias;
	float shadowRadius;
	vec2 shadowMapSize;
};

#endif

uniform vec3 reflectiveColors1[5];

#if nLightSources &gt; 0
	vec3 L[nLightSources*nLightInfoComps];

#endif

#if NUM_DIR_LIGHTS &gt; 0
	for (int iDirLight = 0; iDirLight &lt; NUM_DIR_LIGHTS; ++iDirLight)
	{
		vec3 ldir = directionalLights[iDirLight].direction;
		L[iDirLight] = ldir;
		L[iDirLight + nReflectedIdx * nLightSources] = reflect(-ldir, N);
		lightColors[iDirLight] = directionalLights[iDirLight].color;
	}
#endif
#if NUM_POINT_LIGHTS &gt; 0
	for (int iDirLight = 0; iDirLight &lt; NUM_POINT_LIGHTS; ++iDirLight)
	{
		vec3 ldir = normalize(pointLights[iDirLight].position- frag_position.xyz);
		L[iDirLight+POINT_LIGHTS_BASE] = ldir;
		L[iDirLight+POINT_LIGHTS_BASE + nReflectedIdx * nLightSources] = reflect(-ldir, N);
		lightColors[iDirLight+POINT_LIGHTS_BASE] = pointLights[iDirLight].color;
	}
#endif

	vec4 EnvDiffTexel;
	{
		vec2 sphSpecTexCoords = vec2(atan(N.z, N.x)/3.14159/2.0, N.y/2.0-0.5);
		EnvDiffTexel = texture2D(EnvDiff0, sphSpecTexCoords);
	}

		vec3 bumpv = texel1.rgb*2.0-256./255.;
		bumpv.xy *= BumpIntensity0;
		bumpv = normalize(bumpv);
		vec3 baseOy = cross(N, Ox);
		N1 = bumpv.z*N + bumpv.x*Ox-bumpv.y*baseOy;
	}

	for (int iDirLight = 0; iDirLight &lt; nLightSources; ++iDirLight)
		L[iDirLight + nReflectedIdx1 * nLightSources] = reflect(-L[iDirLight], N1);

	{
		vec2 sphSpecTexCoords = vec2(atan(N1.z, N1.x)/3.14159/2.0, N1.y/2.0-0.5);
		EnvDiffTexel1 = texture2D(EnvDiff0, sphSpecTexCoords);

		vec3 diffuse = reflectiveColors1[emissiveIdx] + ambientLightColor * reflectiveColors1[ambientIdx];
		vec3 specular = vec3(0.0);
#if nLightSources &gt; 0
		for (int iDirLight = 0; iDirLight &lt; nLightSources; ++iDirLight)
		{
			float diffuseIntensity = dot(L[iDirLight], N1);

				{

					diffuse += diffuseIntensity * reflectiveColors1[diffuseIdx] * lightColors[iDirLight];

		}

		gl_FragColor.a = opacity;
		gl_FragColor.rgb = min(vec3(1.0), (specular + diffuse));
	}
	gl_FragColor.a *= fMasterOpacity;
}

#define maxBeziers 16
#define NEEDSTANYEXCOORDS 0

#error not implemented yet - no reason was found to support it
#endif

// Operation types
#define OT_NONE 0.0
#define OT_ARC_DEFORM 1.0
#define OT_CURVED_CREASE_DEFORM 2.0


//struct Bezier
//{
//	vec2 points[4];
//	vec3 props; // min, max, dmgZone
//}; // smarter parameter encoding needed! NB!!!!

uniform vec2 BezierPoints[maxBeziers*4];
uniform vec3 BezierProps[maxBeziers];

// INTERFACE

	//mutable uniforms (per node/side)
//uniform Bezier B[maxBeziers];
uniform vec4 arcData;
uniform vec4 curvedData; // each component is angle for one of the four curvedBashDeformators

#endif

uniform mat4 designToVertexMatrix;	//describes the transformation from design to vertex coordinates (3D - including the thickness, but flat(unfolded) ). inverse ot designToVertexMatrix
#endif

uniform float opType; // Operation Type FLag
attribute vec4 info1, info2, info3, info4; // info = { fNorm.xy -&gt; normalized 2D vector, info.z - scalar (magnitude of effect) -&gt; (0;1], info.w: zero-based bezier index, -1 for none  }
attribute vec2 curvedInfo1, curvedInfo2, curvedInfo3, curvedInfo4; // curvedInfo = {curvedInfo.x = Offset from folding edge, curvedInfo.y = Displacement weight}
// curvedNormInfo = {curvedNormInfo.x = angle of the tangent of the crease curve, curvedNormInfo.y - lenght of the segment perpendicular to the fold line, curvedNormInfo.z = angle of rotation of the fold line}
attribute vec3 curvedNormInfo1, curvedNormInfo2, curvedNormInfo3, curvedNormInfo4; 
// ~~~~~~~~~ outputs of the shader: &apos;position&apos; is transformed position of the vertex (in the final 3D) and &apos;normalVector&apos; is the normal to it;
//&apos;matTexCoords&apos; and &apos;sheetTexCoords&apos; are the transformed texture coordinates of the vertex (we use 2-D textures)

#endif

//This method calculates the displacements to apply to a vertex and its normal implied by a certain deformator
//All the calculations are caried out in the original (that of the mesh) coord-system
//@vertInfo is one of the info entries - cpecifies index of deformator and how the vertex is to be affected by it.
//@posOffset is displacement to be applied to the vertex (according to this vertInfo)
//   at the end the middle of all the offsets applied from all the deformators is applied
//@modifiedNorm is the normal calculated by this deformator
//@outWeight is the weight of this deformator for this vertex.
//@texOrigin is the &apos;vertex coordinates&apos; for which texture coordinates must be calculated. its a modification of the original gl_Veretx
bool transform(vec4 vertInfo, out vec4 posOffset, out vec4 Tex) // p = [0..3]; Vert = deviation iff &apos;true&apos; is returned
{
	posOffset = vec4(0.0);
	Tex = vec4(0.0);
		
	if (vertInfo.w &lt; 0.0)
		return false;
	int idxB = int(vertInfo.w);             //idex in &apos;B&apos; to use. -1 stands for &apos;none&apos;

	vec2 curCurvPoint0= BezierPoints[idxB*4];
	vec2 curCurvPoint1= BezierPoints[idxB*4+1];
	vec2 curCurvPoint2= BezierPoints[idxB*4+2];
	vec2 curCurvPoint3= BezierPoints[idxB*4+3];

	float flVertexScalar = vertInfo.z;		//value between 0 and 1 describing the &apos;relevance&apos; of the vertex from the deformator

		return false;

	float t = (flVertexScalar - curCurvProps.x) / (curCurvProps.y - curCurvProps.x); // pure linear remap
		//the bezier curve is defined as
		//cp[0]*(1-t)^3 + 3*cp[1]*t*(1-t)^2 + 3*cp[2]*t^2*(1-t)+3*cp[3]*t^3
		//V is the basis polynomes (1-t)^3 ...)

		//T = V&apos;s derivative
	vec4 T = vec4(-3.0*(1.0-t)*(1.0-t), 9.0*t*t-12.0*t+3.0, 6.0*t-9.0*t*t, 3.0*t*t);
	vec4 V = vec4( pow(1.0 - t, 3.0),
					-T.x*t,//3.0 * t * (1.0 - t) * (1.0 - t), // do NOT ever, ever forget the coefficients
					T.w*(1.0-t),//3.0 * t * t			* (1.0 - t),
	               pow(t, 3.0)

//	mat4x2 M = mat4x2(curCurvPoint0, curCurvPoint1, curCurvPoint2, curCurvPoint3);
		//posOnBezier is the position of the point with parameter &apos;t&apos; on the bezier curve
		//M*V = cp[0]*(1-t)^3 + 3*cp[1]*t*(1-t)^2 + 3*cp[2]*t^2*(1-t)+3*cp[3]*t^3
//	vec2 posOnBezier = (M*V).xy;
	vec2 posOnBezier = vec2(dot(Mx, V), dot(My, V));

		//posOffset = the offset of the point from its original position.

	if ((vec4(position, 1.)).z&gt;0.0)

	posOffset.xyz = /* bezier */vec3(posOnBezier.x * vertInfo.xy - posOriginInZone, ptFaceNormalZ*posOnBezier.y); 			//the positino of the point after transformed by the bezier.
	
	// tex gen
	//vec2 P,Q;
	//P = gl_Vertex.xy - (flVertexScalar - curCurvProps.x) * curCurvProps.z * vertInfo.xy;
	//Q = gl_Vertex.xy + (curCurvProps.y - flVertexScalar) * curCurvProps.z * vertInfo.xy;
	//Tex = (1.0-t)*P + t*Q;
		//Staso: tova ne go shvastam mnogo, ama e rezultata ot prostjavaneto na gornamta smetka
	//Tex = gl_Vertex + vec4((t*(curCurvProps.y - curCurvProps.x) * curCurvProps.z) * vertInfo.xy, 0., 0.);
	//float max=1.0, min=0.0;(max-min) * 
	float corr = ((posOnBezier.x/curCurvPoint3.x) - flVertexScalar);
	Tex = (vec4(position, 1.)) + vec4(vertInfo.xy*(corr*curCurvProps.z), 0.0, 0.0);
	//(x-c.x)/(o.x-c.x)

	posOffset.w = t;
	return true;
}


vec3 calcNormal(float displacement, vec2 info, vec3 normInfo)
{
	float alpha = normInfo.x; // Angle of the tanget to the curve
	float weight = info.y;
	float lenght = normInfo.y; // Length of the segment perpendicular to the fold line
	float flatFactor = float(lenght == 0.0);
	float sin_beta = displacement / sqrt(pow(weight * lenght, 2.0) + displacement * displacement + flatFactor);
	float cos_beta = sqrt(1.0 - sin_beta * sin_beta);
	float gamma = normInfo.z;
	vec3 norm1 = vec3(cos(alpha), 0.0, sin(alpha)); // Normal vector from fold edge curvature
	vec3 norm2 = flatFactor * vec3(0.0, 1.0, 0.0) + (1.0 - flatFactor) * vec3(0.0, cos_beta, sin_beta); // Normal vector from interpolation
	mat3 rotation = mat3(					// Rotate arround Z axis
		cos(gamma)	, -sin(gamma)	, 0.0,
		sin(gamma)	,  cos(gamma)	, 0.0,
		0.0			, 0.0			, 0.0
	);
	vec3 norm = cross(norm1, norm2);
	return rotation * norm;
}

float calcDisplacement(vec2 info, float angle)
{
	float offset = info.x;
	float weight = info.y;
	float alpha = angle / 2.0;
	float displacement = offset * tan(alpha);
	return /* weight * */ displacement;
}

	{

		float weight = float(curvedData[i] == 8.123);

void transformArc()
{
	//arcData.xy - normal
	//arcData.z - distance
	//arcData.w - curvature = 1.0/radius

	float arcLength = dot((vec4(position, 1.)).xy, arcData.xy) - arcData.z;

	float a_cos = cos(alpha);

	//which is stransfomed into
	// faceArcXY, origOy, faceNorm, 
	//1: vec3(arcData.xy,0)									--------&gt;   1&apos;: faceArcXY = cos*arcData.xy + sin*vec3(0,0,1)

	//3: vec3(0,0,1)												--------&gt;   3&apos;: faceNorm = vec3(-a_sin*arcData.xy, a_cos)
	mat3 bendMatr;
	{
//		the code bellow is not exactly bug-free.... and producess too much code - some old NVIDIA cards can not handle it	
//		mat3 baseCS = mat3( arcData.x,   arcData.y, 0., 
//											 -arcData.y,   arcData.x, 0., 
//															 0.,          0., 1.);
//		mat3 transformedCS = mat3( a_cos*arcData.x, a_cos*arcData.y, a_sin,
//																		-arcData.y,       arcData.x,    0.,
//															-a_sin*arcData.x,-a_sin*arcData.y, a_cos);
//		transformedCS = transpose(transformedCS);
//		bendMatr = transformedCS*baseCS;
//		the solution which follows is from the math.dll (simplyfified based on the fact that rotaxis.dz==0.
//see Rotation3D::SetCS(const Vector3D&amp; v, double cosa, double sina) for &apos;how come&apos; the rest is just simplifactions

		vec2 negcos_xy2 = arcData.xy*arcData.xy*negcos;  // (x*x*(1-cos), y*y*(1-cos))
		vec2 xy_sin = arcData.xy*a_sin;                   // (x*sin, y*sin)
		float negcos_x_y = negcos*arcData.x*arcData.y;   // x*y*(1-cos)
		
		bendMatr = mat3(a_cos + negcos_xy2.y, -negcos_x_y          , xy_sin.x,
		                -negcos_x_y          , a_cos + negcos_xy2.x, xy_sin.y,
		                -xy_sin.x            , -xy_sin.y            , a_cos);
	}
                                       
	//bendMatr contains only the rotation component of the matrix, without any translation                            
	//(gl_Vertex.x, gl_Vertex.y, 0) is the &apos;base&apos; initial point
	//and basePos will is the required final position of the &apos;base&apos; point
	vec3 basePos;
	if ((alpha &lt; -0.03) || (alpha &gt; 0.03))
		basePos = vec3((vec4(position, 1.)).xy - arcData.xy*(arcLength-a_sin/arcData.w), negcos/arcData.w);
	else	
		basePos = vec3((vec4(position, 1.)).xy, arcLength*arcLength*arcData.w/2.0);

	//vPosOffset is the offset vector from base initial position to the position produced by creases
	//if there are no creases, it would be (0,0,position.z)
	vec3 vPosOffset = vec3(frag_position.xy-(vec4(position, 1.)).xy, frag_position.z);
	frag_position.xyz = basePos+(bendMatr*vPosOffset);

	normalVector = bendMatr*normalVector;
#if NEEDSTOXVECTOR
	oxVector = bendMatr*oxVector;
#endif		
}


void main()
{
#if NEEDSTANYEXCOORDS
	vec4 tPos;
#endif
	
		//accumulators used to calculate the avarage of 
	vec4 sumVertOffset = vec4(0.0), curVertOffset;
		//texture avaraging data
	vec4 sumTex = vec4(0.0), curTex;


{
	if (transform(info1, /*out*/curVertOffset, /*out*/curTex))
	{
		sumVertOffset.xyz += curVertOffset.w*curVertOffset.xyz;
		sumTex += curVertOffset.w*curTex;
		sumVertOffset.w += curVertOffset.w;
	}
	if (transform(info2, /*out*/curVertOffset, /*out*/curTex))
	{
		sumVertOffset.xyz += curVertOffset.w*curVertOffset.xyz;
		sumTex += curVertOffset.w*curTex;
		sumVertOffset.w += curVertOffset.w;
	}
	if (transform(info3, /*out*/curVertOffset, /*out*/curTex))
	{
		sumVertOffset.xyz += curVertOffset.w*curVertOffset.xyz;
		sumTex += curVertOffset.w*curTex;
		sumVertOffset.w += curVertOffset.w;
	}
	if (transform(info4, /*out*/curVertOffset, /*out*/curTex))
	{
		sumVertOffset.xyz += curVertOffset.w*curVertOffset.xyz;
		sumTex += curVertOffset.w*curTex;
		sumVertOffset.w += curVertOffset.w;
	}
}

//#if NEEDSTOXVECTOR	
////	oxVector = (designToVertexMatrix*vec4(gl_Normal.z, 0., 0., 0.)).xyz;
//	oxVector = designToVertexMatrix[0].xyz * gl_Normal.z;
//#endif
	if (sumVertOffset.w == 0.0)
	{		//flat surface: screw the data above.
		frag_position      = vec4(position, 1.);

#if NEEDSTANYEXCOORDS
		tPos = vertexToDesignMatrix * vec4(position, 1.);
#endif
	}
	else
	{
			//the updated position (after applying modifiers)
		frag_position      = vec4(position, 1.)+vec4(sumVertOffset.xyz/sumVertOffset.w, 0.);

#if NEEDSTANYEXCOORDS
		tPos = vertexToDesignMatrix * (sumTex/sumVertOffset.w);
#endif
	}

	normalVector = normal;
	// if (arcData.w!=0.0)
	if (opType == OT_ARC_DEFORM)
		transformArc();

	if (opType == OT_CURVED_CREASE_DEFORM)
		transformCurved();

mat4 ModelViewProjectionMatrix=projectionMatrix * modelViewMatrix;
mat3 NormalMatrix= normalMatrix;
mat4 ModelViewMatrix= modelViewMatrix;

	gl_Position   = ModelViewProjectionMatrix * frag_position;
		//transform from panel to user space
	normalVector = NormalMatrix * normalVector;
#if NEEDSTOXVECTOR	
	oxVector     = NormalMatrix * oxVector;
#endif	
	frag_position     = ModelViewMatrix * frag_position;

		//calculate texture coordinates ShaderCodeCalculasGen

}

<code sid="FRAGMENT_SH">
#define ambientIdx 0
#define diffuseIdx 1
#define specularIdx 2
#define emissiveIdx 3
#define envReflectivityIdx 4
#define shininessIdx 0
#define opacityIdx 1
#define envAttenuationIdx 2
#define bumpsIntensityIdx 3
#define nReflectedIdx 1
#define nLightInfoComps 2
varying vec4 frag_position;
varying vec3 normalVector;
uniform float fMasterOpacity;
uniform sampler2D EnvDiff0;
uniform float environmentDiffLightCoef;
uniform vec3 ambientLightColor;
#if NUM_DIR_LIGHTS &gt; 0
struct DirectionalLight
{
	vec3 direction;
	vec3 color;
	int shadow;
	float shadowBias;
	float shadowRadius;
	vec2 shadowMapSize;
};
uniform DirectionalLight directionalLights[ NUM_DIR_LIGHTS ];
#endif

#if NUM_POINT_LIGHTS &gt; 0
struct PointLight {
	vec3 position;
	vec3 color;
	float distance;
	float decay;
	int shadow;
	float shadowBias;
	float shadowRadius;
	vec2 shadowMapSize;
};
uniform PointLight pointLights[ NUM_POINT_LIGHTS ];
#define POINT_LIGHTS_BASE NUM_DIR_LIGHTS
#endif

#define nLightSources (NUM_DIR_LIGHTS+NUM_POINT_LIGHTS)
uniform vec3 reflectiveColors0[5];
uniform vec4 colorsCharacteristics0;

void main()
{
	vec3 N = normalize(normalVector);
	vec3 V = normalize(-frag_position.xyz);

#if nLightSources &gt; 0
	vec3 L[nLightSources*nLightInfoComps];
	vec3 lightColors[nLightSources];
#endif

#if NUM_DIR_LIGHTS &gt; 0
	for (int iDirLight = 0; iDirLight &lt; NUM_DIR_LIGHTS; ++iDirLight)
	{
		vec3 ldir = directionalLights[iDirLight].direction;
		L[iDirLight] = ldir;
		L[iDirLight + nReflectedIdx * nLightSources] = reflect(-ldir, N);
		lightColors[iDirLight] = directionalLights[iDirLight].color;
	}
#endif
#if NUM_POINT_LIGHTS &gt; 0
	for (int iDirLight = 0; iDirLight &lt; NUM_POINT_LIGHTS; ++iDirLight)
	{
		vec3 ldir = normalize(pointLights[iDirLight].position- frag_position.xyz);
		L[iDirLight+POINT_LIGHTS_BASE] = ldir;
		L[iDirLight+POINT_LIGHTS_BASE + nReflectedIdx * nLightSources] = reflect(-ldir, N);
		lightColors[iDirLight+POINT_LIGHTS_BASE] = pointLights[iDirLight].color;
	}
#endif

	vec4 EnvDiffTexel;
	{
		vec2 sphSpecTexCoords = vec2(atan(N.z, N.x)/3.14159/2.0, N.y/2.0-0.5);
		EnvDiffTexel = texture2D(EnvDiff0, sphSpecTexCoords);
	}

	{
		vec3 diffuse = reflectiveColors0[emissiveIdx] + ambientLightColor * reflectiveColors0[ambientIdx];
		vec3 specular = vec3(0.0);
#if nLightSources &gt; 0
		for (int iDirLight = 0; iDirLight &lt; nLightSources; ++iDirLight)
		{
			float diffuseIntensity = dot(L[iDirLight], N);
				if (diffuseIntensity &gt; 0.0)
				{
					float specularIntensity = pow(max(0.0, dot(L[iDirLight + nReflectedIdx * nLightSources], V)), colorsCharacteristics0[shininessIdx]); 
					diffuse += diffuseIntensity * reflectiveColors0[diffuseIdx] * lightColors[iDirLight];
					specular += specularIntensity * reflectiveColors0[specularIdx] * lightColors[iDirLight];
				}
		}
#endif
		{
			diffuse += EnvDiffTexel.xyz * reflectiveColors0[diffuseIdx] * (environmentDiffLightCoef * EnvDiffTexel.a);
		}
		float opacity = colorsCharacteristics0[opacityIdx];
		gl_FragColor.a = opacity;
		gl_FragColor.rgb = min(vec3(1.0), (specular + diffuse));
	}
	gl_FragColor.a *= fMasterOpacity;
}
